PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE event (
		id INTEGER PRIMARY KEY,
		height INTEGER NOT NULL,
		tipset_key BLOB NOT NULL,
		tipset_key_cid BLOB NOT NULL,
		emitter_addr BLOB NOT NULL,
		event_index INTEGER NOT NULL,
		message_cid BLOB NOT NULL,
		message_index INTEGER NOT NULL,
		reverted INTEGER NOT NULL
	);
CREATE TABLE event_entry (
		event_id INTEGER,
		indexed INTEGER NOT NULL,
		flags BLOB NOT NULL,
		key TEXT NOT NULL,
		codec INTEGER,
		value BLOB NOT NULL
	);
CREATE TABLE _meta (
		version UINT64 NOT NULL UNIQUE
	);
CREATE INDEX height_tipset_key ON event (height,tipset_key);
CREATE INDEX event_emitter_addr ON event (emitter_addr);
CREATE INDEX event_entry_key_index ON event_entry (key);
COMMIT;
